import React, { useEffect, useState } from "react";
import { Paper,TableContainer,Table,TableHead,TableRow,TableCell,TableBody, TablePagination } from "@material-ui/core";

import useStyle from "./styles";



  const Dashboard = () => {
  const classes = useStyle();
  const [data, setData ] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/data')
    .then(response => response.json())
    .then((data) => setData(data));
  },[])

  interface column {
    id: 'id' | 'date' | 'severity' | 'desc'  ;
    label: string;
    minWidth?: number;
  }
  const columns: column[] = [
    { id: 'id', label: 'CVE ID', minWidth: 170 },
    { id: 'date', label: 'PUBLISHED DATE', minWidth: 100 },
    { id: 'severity', label: 'SEVERITY', minWidth: 100 },
    { id: 'desc', label: 'DESCRIPTION', minWidth: 100 },

  ]
  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow> {columns.map((column) =>(
            <TableCell key={column.id} align='left' style={{ minWidth: column.minWidth }}>
            {column.label}
            </TableCell>))}
            </TableRow>
          </TableHead>
          <TableBody>
             {}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default Dashboard;
